Brioche cake: soft and fragrant, perfect for a delicious breakfast!

INGREDIENTS
150ml (⅔ cup) warm milk;
15g (2 tbsp) fresh yeast;
40g (½ cup) sugar;
a pinch of salt;
1 egg;
½ tsp vanilla extract;
50g (3 tbsp) sour cream;
350g (2 3/4 cups) all-purpose flour;
Vanilla custard.
METHOD
Whisk warm milk with sugar and fresh yeast. Set aside for 10 minutes.
Add an egg, vanilla, and sour cream, whisk to combine.
Mix in flour and salt, knead the dough until smooth, then set aside for 1 hour.
Punch excess air from the dough and cut it into 4 parts (3 equal and 1 smaller).
Roll out 3 pieces of dough and fill them with custard. Roll and pinch the edges.
Braid 3 pieces and pinch the edges. Connect both edges of the braid and add a leftover quarter of the dough forming a rim on the bottom.
Set aside for 30 minutes, brush with egg wash, and then bake for 40-45 minutes at 200°C/400°F.

